import React from 'react';
import Footer from '../../components/Footer';
import Header from '../../components/Header';
import Input from '../../components/Input';
import Button from '../../components/Button';
import ButtonInscricao from '../../components/Button-inscricao';
import '../../assets/style/global.css';
import './style.css';

function Vagas() {

    return (
        <div>
            <Header />
            <div className="vagas">
                <div className="title">
                    <h1>Encontre a sua vaga!</h1>
                </div>
                <div className="pesquisa">
                    <Input id="InputEdit" name="pesquisa" label="" placeholder="Buscar vaga"/>
                </div>
                <div className="conteudo">
                    <div className="TitleImg">
                        <div className="img">
                            <img src="" alt="Foto vaga"/>
                        </div>
                        <div className="title1">
                            {/* Nome da vaga */}
                            <h1>Analista de sistemas</h1>

                            {/* Local da vaga */}
                            <h2>São Paulo, Zona Leste</h2>

                            {/* Salário */}
                            <h3>R$2000.00</h3>
                        </div>
                    </div>
                    <div className="buttons">
                        <ButtonInscricao value="Inscrever-se"/>
                        <ButtonVermais name="Ver mais..." />
                    </div>
                </div>



            </div>
            <Footer />
        </div>
    )
}

export default Vagas;
